      <p>
        Este é um espaço criado por <strong>Gabryell Reis</strong> para a atualização de seu portifólio pessoal.
        Acesse o menu no cabeçalho para acessar a página de Perfil ou Projetos.
      </p>
    </div>
  ) 
};

export default HomeBody;
